Cluster(n_workers=args.num_workers, threads_per_worker=args.threads_per_worker)\n\n        # Compute SfM solution.\n        with Client(cluster), performance_report(filename=\"dask-report.html\"):\n            sfm_result = sfm_result_graph.compute()\n        assert isinstance(sfm_result, GtsfmData)\n\n        &lt;/pre&gt;\n        "},"id":"1347","type":"Div"},{"attributes":{},"id":"1093","type":"ResetTool"},{"attributes":{},"id":"1441","type":"BasicTickFormatter"},{"attributes":{"axis_label":"Bytes","formatter":{"id":"1313"},"major_label_policy":{"id":"1431"},"ticker":{"id":"1259"}},"id":"1258","type":"LinearAxis"},{"attributes":{"child":{"id":"1346"},"title":"Scheduler Logs"},"id":"1356","type":"Panel"},{"attributes":{},"id":"1442","type":"AllLabels"},{"attributes":{"axis":{"id":"1258"},"dimension":1,"ticker":null},"id":"1261","type":"Grid"},{"attributes":{},"id":"1259","type":"BasicTicker"},{"attributes":{"child":{"id":"bk-bandwidth-type-plot"},"title":"Bandwidth (Types)"},"id":"1354","type":"Panel"},{"attributes":{"line_color":"#1f77b4","x":{"field":"time"},"y":{"field":"memory"}},"id":"1270","type":"Line"},{"attributes":{"high":1,"low":0,"palette":["#ffffFF","#fefeFF","#fdfdFF","#fcfcFF","#fbfbFF","#fafaFF","#f9f9FF","#f8f8FF","#f7f7FF","#f6f6FF","#f5f5FF","#f4f4FF","#f3f3FF","#f2f2FF","#f1f1FF","#f0f0FF","#efefFF","#eeeeFF","#ededFF","#ececFF","#ebebFF","#eaeaFF","#e9e9FF","#e8e8FF","#e7e7FF","#e6e6FF","#e5e5FF","#e4e4FF","#e3e3FF","#e2e2FF","#e1e1FF","#e0e0FF","#dfdfFF","#dedeFF","#ddddFF","#dcdcFF","#dbdbFF","#dadaFF","#d9d9FF","#d8d8FF","#d7d7FF","#d6d6FF","#d5d5FF","#d4d4FF","#d3d3FF","#d2d2FF","#d1d1FF","#d0d0FF","#cfcfFF","#ceceFF","#cdcdFF","#ccccFF","#cbcbFF","#cacaFF","#c9c9FF","#c8c8FF","#c7c7FF","#c6c6FF","#c5c5FF","#c4c4FF","#c3c3FF","#c2c2FF","#c1c1FF","#c0c0FF","#bfbfFF","#bebeFF","#bdbdFF","#bcbcFF","#bbbbFF","#babaFF","#b9b9FF","#b8b8FF","#b7b7FF","#b6b6FF","#b5b5FF","#b4b4FF","#b3b3FF","#b2b2FF","#b1b1FF","#b0b0FF","#afafFF","#aeaeFF","#adadFF"
